import ChildComponent from './childComponent'


class ParentComponent extends React.Component {
    constructor(props){
        super(props)
        this.state = {
            name : "",
            age:"",
            address:""
        }
        this.userDetails = this.userDetails.bind(this)
    }
    userDetails = () =>{
        this.setState({
            name: "Ravi Kumar",
            age: 23,
            address:"New delhi"
        });
    }
    render(){
        return (
            <ChildComponent userDetails={this.userDetails}/>
        )
    };
};

export default ParentComponent
